import React from 'react';

// Mock data
const DATA = [
  { id: '1', title: 'Cappuccino', price: 'Rp75.000', available: true },
  { id: '2', title: 'Americano', price: 'Rp73.000', available: false },
  // Add more items...
];

const MenuPage = () => {
  // Item component
  const Item = ({ title, price, available }) => (
    <div className="item">
      <div className="title">{title}</div>
      <div className="price">{price}</div>
      {available ? (
        <button className="button">Add to Cart</button>
      ) : (
        <div className="soldOut">Habis</div>
      )}
    </div>
  );

  return (
    <div>
      <h1>Menu</h1>
      <div className="menu">
        {DATA.map(item => (
          <Item key={item.id} title={item.title} price={item.price} available={item.available} />
        ))}
      </div>
    </div>
  );
};

export default MenuPage;
